import React from "react";
import profile from "./assets/profile.jpg";

// coffee: #3B2C35
// darkGreen: #5B6C5D
// ocean: #59C9A5
// aqua: #56E39F

const cardStyle = {
  margin: "40px",
  border: "10px solid #59C9A5",
};

function AboutMe() {
  return (
    <div>
      <div className="card" style={cardStyle}>
        <div className="card-header">About Me</div>
        <img src={profile} className="card-img-top" alt="Picture of me"></img>
      </div>
    </div>
  );
}

export default AboutMe;
